import React from 'react';
import s from './Sidebar.module.css';

const Sidebar = () => {
    return (
            <div>
                FRIENDS
                <div className={s.avatar}>
                    <img src="https://i.pinimg.com/736x/2d/dc/25/2ddc25914e2ae0db5311ffa41781dda1.jpg"/>
                    <div>
                        aynjy
                    </div>
                </div>
            </div>
    )
}

export default Sidebar;
